query FavoriteShowsQuery {
  me {
    ...Shows_me
    __id
  }
}

fragment Shows_me on Me {
  followsAndSaves {
    shows(first: 10, after: "") {
      edges {
        node {
          name
          __id
          __typename
        }
        cursor
      }
      pageInfo {
        endCursor
        hasNextPage
      }
    }
  }
  __id
}
